IF OBJECT_ID('dbo.proc_transform_337', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_337;
GO
CREATE PROCEDURE dbo.proc_transform_337
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_337
    SET payload = LEFT(payload, 1000) + N'|V4-337|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_337;
END
GO
IF OBJECT_ID('dbo.audit_v4_337', 'U') IS NULL
